  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"page-content"}}>{`Page Content`}</MDXTag>
<MDXTag name="p" components={components}>{`The Page Contet element is the wrapper for content within the page. It should wrap all page content and come directly after the Page Header element.`}</MDXTag>
           </MDXTag>
  }
}
MDXContent.isMDXComponent = true
